import axios from "axios";
import { toRaw } from "vue";
export default {
  name: "AgendaPage",
  data() {
    return {
      state: 1
    };
  },
  methods: {
    async fetchData() {
      try {
        const response = await axios.get('ServletGetBookingsForUser', {
          params: {
            action: 'web',
            stato: toRaw(this.state)
          }
        });
        console.log(response.data);
      } catch (e) {
        console.error(e);
      }
    }
  }
};
